            if (tileInfo) {
                //tilePlugin = tileInfo.plugin;
                tile = tileInfo.el;

                tile.remove();
            }

            extensionsByName[extension.getName()] = null;

            after = [];

            for (n = 0, len = extensions.length; n < len; n += 1) {
                if (extensions[n] === extensionInfo) {
                    continue;
                }

                after.push(extensions[n]);

            }

